import React, { useState, useEffect } from "react";
import axios from "axios";

const Reviews = () => {
  const [reviews, setReviews] = useState([]);
  const [newComment, setNewComment] = useState("");
  const [newRating, setNewRating] = useState("");
  const [newDate, setNewDate] = useState("");

  useEffect(() => {
    // Fetch the list of items when the component mounts
    axios
      .get("https://651c0dd4194f77f2a5af4f26.mockapi.io/review")
      .then((response) => setReviews(response.data))
      .catch((error) => console.error(error));
  }, []);

  const addItem = () => {
    // Send a POST request to create a new item
    axios
      .post("https://651c0dd4194f77f2a5af4f26.mockapi.io/review", {
        comment: newComment,
        rating: newRating,
        date: newDate,
      })
      .then((response) => {
        setReviews([...reviews, response.data]);
        setNewComment("");
        setNewRating("");
        setNewDate("");
      })
      .catch((error) => console.error(error));
  };
  return (
    <>
      <div class="container section single-movie">
        <div class="row">
          <div class="col-sm-7">
            <h2>Comments</h2>
            <div class="comments">
              {reviews.map((review) => (
                <div class="row" key={review.id}>
                  <div class="col-sm-2">
                    <img src="assets/images/user.png" class="Luke Barrett" />
                  </div>
                  <div class="col-sm-9">
                    <span class="date">{review.date}</span>
                    <h4 class="no-underline">Luke Barrett</h4>
                    <p style={{ marginBottom: "2px" }}>
                      Rating: {review.rating} stars
                    </p>
                    <p>{review.comment}</p>
                  </div>
                </div>
              ))}
            </div>
          </div>
          <div class="col-sm-4 col-sm-push-1">
            <h2>Leave a comment</h2>
            <form>
              <div class="form-group">
                <label>Name *</label>
                <FormControl
                  type="text"
                  placeholder="New Review"
                  value={newComment}
                  onChange={(e) => setNewItemText(e.target.value)}
                />
              </div>
              <div class="form-group">
                <label>Email *</label>
                <input type="email" />
              </div>
              <div class="form-group">
                <label>Website</label>
                <input type="text" />
              </div>
              <div class="form-group">
                <label>Comments *</label>
                <textarea rows="5"></textarea>
              </div>
              <div class="form-group right-align">
                <button class="btn btn-ghost">Post comment</button>
              </div>
            </form>
          </div>
        </div>
      </div>

      <div class="section small-padding border-top">
        <div class="container">
          <div class="row">
            <div class="col-sm-12 cta">
              <p>Need help? Contact our support team on</p>
              <p class="gradient-text">0330 123 4567</p>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Reviews;
